import NavItem from "./navitem";

const NavBar = (props) => {
	return (
		<nav className="navbar">
      		<div className="app-title"><span>Self.OKRs</span></div>
      		<div className="links-menu">
			  	<ul>
					<NavItem title={"Goals"} />
					<NavItem title={props.user.username} />
				</ul>
			</div>
    	</nav>
	);
}

export default NavBar;
